CREATE TABLE `customer_enquiries` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `description` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `enquiry_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'general' COMMENT 'general|engine',
  `user_id` int NOT NULL DEFAULT '0',
  `order_id` int NOT NULL DEFAULT '0',
  `category_id` int NOT NULL DEFAULT '0',
  `sub_category_id` int NOT NULL DEFAULT '0',
  `product_id` int NOT NULL DEFAULT '0',
  `shelf_life` int NOT NULL DEFAULT '0',
  `entered_shelf_life` int NOT NULL DEFAULT '0',
  `entered_shelf_life_unit` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `product_weight` decimal(15,2) NOT NULL DEFAULT '0.00',
  `measurement_unit_id` int NOT NULL DEFAULT '0',
  `product_quantity` int NOT NULL DEFAULT '1',
  `storage_condition_id` int NOT NULL DEFAULT '0',
  `packaging_machine_id` int NOT NULL DEFAULT '0',
  `product_form_id` int NOT NULL DEFAULT '0',
  `packing_type_id` int NOT NULL DEFAULT '0',
  `packaging_treatment_id` int NOT NULL DEFAULT '0',
  `recommendation_engine_id` int NOT NULL DEFAULT '0',
  `packaging_material_id` int NOT NULL DEFAULT '0',
  `user_address_id` int NOT NULL DEFAULT '0',
  `country_id` int NOT NULL DEFAULT '0',
  `state_id` int NOT NULL DEFAULT '0',
  `city_id` int NOT NULL DEFAULT '0',
  `city_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `flat` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `area` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `land_mark` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `address` text COLLATE utf8mb4_unicode_ci,
  `pincode` varchar(15) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `quote_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'enquired' COMMENT 'enquired|map_to_vendor|accept_cust|order|closed|auto_reject',
  `status` enum('1','0') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0',
  `seo_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `meta_title` text COLLATE utf8mb4_unicode_ci,
  `meta_description` text COLLATE utf8mb4_unicode_ci,
  `meta_keyword` text COLLATE utf8mb4_unicode_ci,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=160 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
