INSERT INTO `general_settings` VALUES (1,'about_us','<ol><li>Packarma is an app-based platform for customised packaging solutions for the development and/or procurement of packaging materials</li><li>Packaging solutions offered are for:<br>a. Food Products.<br>b. Home and personal care Products.<br>c. Pharma Products.(More categories will be added in the future)</li><li>It is also a packaging material procurement platform where the customer/brand can find information related to packaging as well as procurement options in a easy to use app format.</li><li>We facilitate the procurement and supply of high-quality packaging material for diversified categories like food, cosmetics, pharmaceuticals and HPC via development of regional suppliers at very competitive prices.</li><li>Packarma works on a subscription basis.</li><li>Our team of experienced professionals effectively multisource the entire packaging process under one single roof.</li></ol>',NULL,'2023-01-23 17:16:23'),(2,'terms_condition','<p>The application Packarma is owned and operated by PACKult Studio Private Limited (â€œPackultâ€ or â€œusâ€ or â€œweâ€ or â€œourâ€), having its registered office at 229, Udyog Bhavan, Sonawala Road, Goregaon (East), Mumbai â€“ 400063 and bearing CIN: U74999MH2021PTC366605. Please read the Terms and Conditions of Use carefully before using the Packarma application. By using the Packarma application, you signify your agreement to be bound by Packultâ€™s Terms and Conditions of Use. As enumerated in our Conditions of Use, we share information with our affiliated entities.</p><p>This document is an electronic record in terms of the Information Technology Act, 2000 and published in accordance with the provision of Rule 3(1) of Information Technology (Intermediary Guidelines and Digital Media Ethics Code) Rules, 2021, which requires publishing the rules and regulations, privacy policy and user agreement for usage of this application.</p><p>The application provides a one-stop packaging solution via various vendors to you based on the product type and description provided by you</p><p><strong>Conditions Relating to Your Use of Packarma</strong></p><p>Account</p><p>If you use the application, you are responsible for maintaining the confidentiality of your passwords and any other credentials and for restricting access to your hardware device to prevent unauthorised access to your account. You further agree to accept and take full responsibility for all the activities that occur under and from your account or password. You agree to ensure that the details you provide us with are correct and complete and you undertake to inform us immediately of any changes to the information that you have provided while registering for the application. Packult reserves the right to refuse access to the application, terminate accounts, withhold accounts, or remove or edit content at any time without any prior intimidation to you.</p><p>Term<br>Your access to the application shall be constituted as explicit consent to this Agreement. This Agreement shall continue to be in full force and effect for so long as you are using the application. The application provides a one-stop packaging solution based on the data provided by you. By using the application, you are agreeing to use the Services in a manner consistent with and abide by the terms and conditions of this Agreement, our Privacy Policy, and all applicable laws and regulations.<br>Privacy<br>Please review our Privacy Policy, which governs the use of the application. The personal information/data provided to us by you during the course of usage of this application will be treated as strictly confidential and in accordance with the Privacy Policy and applicable laws and regulations. In any case, if you object to your information being transferred or used or stored, please do not use the application.</p><p>Licence for Application Access<br>Subject to your due compliance with the Terms and Conditions of Use and upon payment of applicable fees, Packult grants you a limited licence to access and make personal use of this application, but not to download (other than page caching) or modify or omit any portion of it. The licence does not include any resale or commercial use of this application or its contents, any collection and use of any product/services listings, descriptions or prices; any derivative use of this application or its contents; any downloading or copying of account information for benefit of another seller; or any use of data mining, or similar data gathering and extraction tools.</p><p>This application or any portion of this application inclusive of but not limited to any copyrighted material, trademarks, or any other proprietary information or intellectual property of Packult, may not be reproduced, duplicated, copied, sold, resold, visited, distributed, circulated or otherwise exploited for any commercial purpose without the express consent of Packult and/or its affiliates, as applicable. Any unauthorised use terminates the permission or license granted by Packult and/or their affiliates and/or subsidiaries, as applicable.</p><p>Conduct<br>You must not use the application in any way that causes, or is likely to cause, the application or access to the application to be interrupted, damaged or impaired in any way. You undertake to agree that you, and not Packult, are responsible for all electronic communications and consent sent from your hardware device to us and you must use the application for lawful purposes only. You must not use the application for any of the below-mentioned purposes:</p><p>for fraudulent purposes, or in connection with a criminal offence or other unlawful activity<br>to send, use or reuse any material that does not belong to you; or is illegal, offensive (including but not limited to material that is sexually explicit content or which promotes racism, bigotry, hatred or physical harm), deceptive, misleading, abusive, indecent, insulting or harassing, blasphemous, defamatory, libellous, obscene, pornographic, paedophilic, or menacing; ethnically objectionable, disparaging or in breach of copyright, trademark, patent, confidentiality, privacy or any other proprietary information or right; or is otherwise injurious to third parties; or relates to or promotes money laundering or gambling; or is harmful to minors in any way; or impersonates another person; or threatens the unity, integrity, defence, security or sovereignty of India or friendly relations with foreign States or public order or causes incitement to the commission of any cognisable offence or prevents investigation of any offence or is insulting other nation; or objectionable or otherwise unlawful in any manner whatsoever; or which consists of or contains software viruses or any other computer code, file or program designed to interrupt, destroy or limit the functionality of any computer resource, political campaigning, commercial solicitation, chain letters, mass mailings or any \"spam; or is patently false and untrue.<br>to cause annoyance, inconvenience, nuisance, or needless anxiety<br>any other purpose considered to be bad in law</p><p>Product pricing</p><p>Product prices listed on the application are current. While every care has been taken to label the products accurately, errors in data entry and updating of these prices may occur. Packult reserves the right to cancel the order in case a transaction has been made where the price indicated was not the correct price. In the rare event that this happens, we will give a full refund of all money received from the customer. Prices are subject to change without advance notice.<br>All prices on this application are given in Indian Rupees. For international cards used on the application, the bank\'s applicable exchange rate and charges will apply. We have no jurisdiction over this and any disputes or queries on exchange rates and bank charges need to be directed to the bank or institution that issued your card or payment instrument.<br>All orders are acknowledged at current pricing. We will bill at the price in effect at the time of receipt of money and raising of an invoice. Our products are liable for taxes, as applicable in India.</p><p>Payment option<br>The following modes of payment are available:<br>a) Credit Cards - Master Card, Visa,</p><p>b) Debit Cards - Master Card, Visa, Maestro and Rupay</p><p>c) Netbanking/Direct Debit payments from select banks in India. A full list is available at the time of Check Out and prior to making payments for purchases</p><p>d) Cash On Delivery.<br>e) UPI payment (Gpay, Paytm, Bhim etc)</p><p>In this section, you will be asked for your address and other contact information as well as payment-related information Once the payment transaction has been successfully completed, your order will be processed upon receipt of the funds from the bank or Credit Card Company. It is at this stage that the sale is said to be complete. Thereafter your products will be shipped based on product availability and the completion of logistics operations related to the same.<br>Security<br>Transactions on the application are protected by [*] and [*] using a [*]. Any information you enter when transacting with the application is sent to cloud-based storage and is encrypted to protect you against unintentional disclosure to third parties. This is an assurance that it follows the best security practices adopted by major online vendors where all payments are processed in real-time for your security and immediate peace of mind. Credit card and Debit card information is not stored by us and is not taken by us. This information is taken directly by the payment gateway provided which is authorised and compliant with the regulations and requirements of various banks and institutions and payment franchisees that it is associated with. You agree to settle any and all disputes with respect to any failed transaction and/or bad gateway with your authorised banking institution. You undertake to not hold Packult or its affiliates liable for any refund or compensation in case of any transaction dispute.</p><p>Delay</p><p>You undertake to not hold Packult liable for any delay in processing of the order or delay caused due to transportation issues. Packult will not undertake or provide or award any type of monetary concession or compensation in such delays.</p><p>Indemnity</p><p>You shall indemnify and hold harmless Packult, its owner, licensee, affiliates, subsidiaries, group companies and their respective officers, directors, agents, and employees, from any claim or demand, or actions including reasonable attorneyâ€™s / legal fees, made by any third party or penalty imposed due to or arising out of your breach of this Terms and Conditions, Privacy Policy and / or any other Policy binding on you or you violation of any law, rules or regulations or the rights (including infringement of intellectual property rights)</p><p>Liability</p><p>The application provides one stop packaging solution based on the type of product description provided by the customrt, since the type of product may vary from Food products, Home and Personal care products and Pharmaceuticals, some of them being perishable nature, in such case you agree not to hold Packult liable in case any damage and / or spillage of the product during packaging and transportation. Further, since the application connects you to the customers based on the product description provided by the customers, any action and / or inaction on the part of the customer shall not be attributed to Packult or its affiliates and / or subsidiaries. In no event shall Packult or any of its affiliates and employees be liable for any indirect, punitive, incidental, special, consequential damages or any other damages resulting from:<br>the use or the inability to use the Services or Products<br>unauthorized access to or alteration of the user\'s transmissions or data<br>breach of condition, representations or warranties<br>any other matter relating to the services including, without limitation, damages for loss of use, data or profits, arising out of or in any way connected with the use or performance of the Platform or Service. You undertake to understand and agrees that any material and/or data downloaded by the application is done entirely at your own discretion and risk and you will be solely responsible for any damage to your hardware or loss of data that results from the download of such material and/or data. To the maximum extend that is permissible under law, Packultâ€™s liability shall be limited to an amount equal to the Products purchased value bought by You. Packult shall not be liable for any dispute or disagreement between you and the customer or any other third party.<br>Failed transaction or bad gateway<br>Any act undertaken by you against the laws of India</p><p>Governing Law and Jurisdiction</p><p>This application is created and controlled by Packult in Mumbai, India and the laws of India shall apply. This agreement is governed and construed in accordance with the Laws of India. You hereby irrevocably consent to the exclusive jurisdiction and venue of courts in Mumbai, Maharashtra, India, in all disputes arising out of or relating to the use of this application. Use of the application is unauthorized in any jurisdiction that does not give effect to all provisions of these terms and conditions, including without limitation this paragraph. You agree to indemnify and hold Packult, its subsidiaries, affiliates, directors, officers and employees, harmless any claim, demand, or damage, including reasonable attorneys\' fees, asserted by any third party due to or arising out of your use of or conduct on the application.</p><p>Entire Agreement</p><p>These Terms and Conditions, together with privacy policy, and other rules and policies posted on the application, which are hereby incorporated as set forth fully in these Terms and Conditions,