DROP TABLE IF EXISTS `order_payments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `order_payments` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL DEFAULT '0',
  `order_id` int NOT NULL DEFAULT '0',
  `product_id` int NOT NULL DEFAULT '0',
  `vendor_id` int NOT NULL DEFAULT '0',
  `payment_mode` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'online' COMMENT 'online_payment',
  `amount` decimal(15,2) NOT NULL,
  `payment_status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending' COMMENT 'pending|semi_paid|fully_paid',
  `transaction_date` date DEFAULT NULL,
  `remark` longtext COLLATE utf8mb4_unicode_ci,
  `gateway_id` text COLLATE utf8mb4_unicode_ci,
  `gateway_key` text COLLATE utf8mb4_unicode_ci,
  `call_from` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'android' COMMENT 'website|android|ios|mobile|facebook|twitter|youtube|social|telecaller|others',
  `ip_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `order_payment_image` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `order_payment_thumb_image` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_by` int NOT NULL DEFAULT '0',
  `updated_by` int NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=96 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
