DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orders` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL DEFAULT '0',
  `vendor_quotation_id` int NOT NULL DEFAULT '0',
  `vendor_id` int NOT NULL DEFAULT '0',
  `vendor_warehouse_id` int NOT NULL DEFAULT '0',
  `customer_enquiry_id` int NOT NULL DEFAULT '0',
  `user_address_id` int NOT NULL DEFAULT '0',
  `category_id` int NOT NULL DEFAULT '0',
  `sub_category_id` int NOT NULL DEFAULT '0',
  `product_id` int NOT NULL DEFAULT '0',
  `shelf_life` int NOT NULL DEFAULT '0',
  `product_weight` decimal(15,2) NOT NULL DEFAULT '0.00',
  `measurement_unit_id` int NOT NULL DEFAULT '0',
  `product_quantity` int NOT NULL DEFAULT '1',
  `storage_condition_id` int NOT NULL DEFAULT '0',
  `packaging_machine_id` int NOT NULL DEFAULT '0',
  `product_form_id` int NOT NULL DEFAULT '0',
  `packing_type_id` int NOT NULL DEFAULT '0',
  `packaging_treatment_id` int NOT NULL DEFAULT '0',
  `recommendation_engine_id` int NOT NULL DEFAULT '0',
  `packaging_material_id` int NOT NULL DEFAULT '0',
  `country_id` int NOT NULL DEFAULT '1',
  `currency_id` int NOT NULL DEFAULT '1',
  `mrp` decimal(15,2) NOT NULL DEFAULT '0.00',
  `sub_total` decimal(15,2) NOT NULL DEFAULT '0.00',
  `gst_amount` decimal(15,2) NOT NULL DEFAULT '0.00',
  `gst_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT 'not_applicable' COMMENT 'not_applicable|cgst+sgst|igst',
  `gst_percentage` decimal(15,2) NOT NULL DEFAULT '0.00',
  `freight_amount` decimal(15,2) NOT NULL DEFAULT '0.00',
  `delivery_type` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'none' COMMENT 'none|admin|delivery_boy|vendor|third_party|customer',
  `grand_total` decimal(15,2) NOT NULL DEFAULT '0.00',
  `commission` decimal(15,2) NOT NULL DEFAULT '0.00',
  `vendor_amount` decimal(15,2) NOT NULL DEFAULT '0.00',
  `customer_pending_payment` decimal(15,2) NOT NULL DEFAULT '0.00',
  `customer_payment_status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending' COMMENT 'pending|semi_paid|fully_paid',
  `vendor_pending_payment` decimal(15,2) NOT NULL DEFAULT '0.00',
  `vendor_payment_status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending' COMMENT 'pending|semi_paid|fully_paid',
  `order_details` longtext COLLATE utf8mb4_unicode_ci COMMENT 'Json Data',
  `product_details` longtext COLLATE utf8mb4_unicode_ci COMMENT 'Json Data',
  `shipping_details` longtext COLLATE utf8mb4_unicode_ci COMMENT 'Json Data',
  `billing_details` longtext COLLATE utf8mb4_unicode_ci COMMENT 'Json Data',
  `order_delivery_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending' COMMENT 'pending|processing|out_for_delivery|delivered|cancelled',
  `processing_datetime` datetime DEFAULT NULL,
  `out_for_delivery_datetime` datetime DEFAULT NULL,
  `delivery_datetime` datetime DEFAULT NULL,
  `delivered_by` int NOT NULL DEFAULT '0',
  `user_choice` text COLLATE utf8mb4_unicode_ci COMMENT 'Json Data',
  `created_by` int NOT NULL DEFAULT '0',
  `updated_by` int NOT NULL DEFAULT '0',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `delivery_in_days` int NOT NULL DEFAULT '7',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
