DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `users` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `phone_country_id` int NOT NULL DEFAULT '0' COMMENT 'phone_code',
  `phone` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `whatsapp_country_id` int NOT NULL DEFAULT '0' COMMENT 'whatsapp_phone_code',
  `whatsapp_no` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `language_id` int NOT NULL DEFAULT '0',
  `currency_id` int NOT NULL DEFAULT '1',
  `gstin` varchar(15) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `gst_certificate` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `approval_status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending' COMMENT 'pending|accepted|rejected',
  `approved_on` datetime DEFAULT NULL,
  `approved_by` int NOT NULL DEFAULT '0' COMMENT 'Admin Id',
  `admin_remark` longtext COLLATE utf8mb4_unicode_ci,
  `subscription_id` int NOT NULL DEFAULT '0',
  `subscription_start` datetime DEFAULT NULL,
  `subscription_end` datetime DEFAULT NULL,
  `type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'normal' COMMENT 'normal|premium',
  `status` enum('1','0') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0',
  `sms_notification` enum('1','0') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1',
  `email_notification` enum('1','0') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1',
  `whatsapp_notification` enum('1','0') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1',
  `fcm_notification` enum('1','0') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1',
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `mkey` longtext COLLATE utf8mb4_unicode_ci,
  `msalt` longtext COLLATE utf8mb4_unicode_ci,
  `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `remember_token` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `is_verified` enum('Y','N') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'N',
  `visiting_card_front` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `visiting_card_back` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `fpwd_flag` enum('Y','N') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'N',
  `last_login` datetime DEFAULT NULL,
  `created_by` int NOT NULL DEFAULT '0',
  `updated_by` int NOT NULL DEFAULT '0',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

